import './App.css';

function App() {
  const age = 0;
  const increaseAge = () => {
    age = age + 1; 
    console.log(age); 
  }


  return( 
    <div className="App"> 
    {age}
  </div>
  );
}

const User = (props) => {
  return (
    <div>
      <h1>{props.name}</h1>
      <h1>{props.age}</h1>
      <h1>{props.email}</h1>
    </div>
  )
}
export default App;
